//The following combines two sorted lists, but first two sorted lists are needed
void Merge(int L[], int start, int end, int mid){
    int i = 0;
    int j = 0;
    int n1 = mid - start + 1;
    int n2 = end - mid;
    int L1[n1], L2[n2];

    //This places the integer in the on the next space in the list given it is larger than the one before it
    for (int p = 0; p < n1; p++ ){
        L1[p] = L[start+p];
        //printf("%d \n", L1[p]);
    }
    for (int q = 0; q < n2; q++ ){
        L2[q] = L[mid+1+q];
        //printf("%d \n", L2[q]);
    }

    while ( i < n1 && j < n2){
        if( L1[i] <= L2[j] ){
            L[start+i+j] = L1[i];
            i = i + 1;
        } else{
            L[start + i + j] = L2[j];
            j = j + 1;
        }
    }
    while (i < n1) {
        L[start + i + j] = L1[i];
        i = i + 1;
    }
    while (j < n2) {
        L[start + i + j] = L2[j];
        j = j + 1;
    }
}

int* MergeSort(int L[], int start, int end){
    if (start < end){
        int mid = (end + start)/2;
        MergeSort(L, start, mid);
        MergeSort(L, mid + 1, end);
        Merge(L, start, end, mid);
    }
    return L;
}

void printList(int L[], int size){
    int i;
    for (i = 0; i < size; i++)
        printf("%d ", L[i]);
    printf("\n");
}